/* ONE dark UI variables
** ---------------------------------------------- */
/* Official variables
** These variables must be defined in every theme
** Source: https://github.com/atom/atom/blob/master/static/variables/ui-variables.less
** ---------------------------------------------- */
/* Custom variables
** These variables are only used in this theme
** ---------------------------------------------- */
/* Packages variables
** These variables are used to override packages
** ---------------------------------------------- */
/* Debug
** Output variables to the top of the UI
** ------------------------------------- */
background-tips {
  display: block;
  pointer-events: none;
  position: absolute;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  overflow: hidden;
}
background-tips .background-message {
  -webkit-user-select: none;
  cursor: default;
}
background-tips .background-message .message {
  padding: 0 30px;
  opacity: 0;
  transition: opacity 0.3s ease-in-out;
}
background-tips .background-message .message.fade-in {
  opacity: 1;
}
background-tips .background-message .message .keystroke {
  border: 2px solid;
  padding: 0 5px;
  border-radius: 9px;
  font-family: "Helvetica Neue", Arial, sans-serif;
}
